 &lt;h2 id=&#34;git基础用法&#34;&gt;&lt;a class=&#34;markdownIt-Anchor&#34; href=&#34;#git基础用法&#34;&gt;#&lt;/a&gt; git 基础用法&lt;/h2&gt;
&lt;hr&gt;
&lt;p&gt;1.git init  初始化一个 Git 仓库，执行完后会在当前目录生成一个 .git 目录 。&lt;br&gt;
2.git init [目录地址] 会在指定目录下 生成一个名为 .git 的目录 。&lt;br&gt;
3.git add 命令告诉 Git 开始对这些文件进行跟踪&lt;/p&gt;
&lt;figure class=&#34;highlight plain&#34;&gt;&lt;table&gt;&lt;tr&gt;&lt;td class=&#34;gutter&#34;&gt;&lt;pre&gt;&lt;span class=&#34;line&#34;&gt;1&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;2&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;3&lt;/span&gt;&lt;br&gt;&lt;/pre&gt;&lt;/td&gt;&lt;td class=&#34;code&#34;&gt;&lt;pre&gt;&lt;span class=&#34;line&#34;&gt;$ git add *.c&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;$ git add README&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;$ git commit -m &amp;#39;初始化项目版本&amp;#39;&lt;/span&gt;&lt;br&gt;&lt;/pre&gt;&lt;/td&gt;&lt;/tr&gt;&lt;/table&gt;&lt;/figure&gt;
&lt;a id=&#34;more&#34;&gt;&lt;/a&gt;  
&lt;p&gt;4.git clone 从现有 Git 仓库中拷贝项目 。&lt;br&gt;
5.git clone &lt;repo&gt; &lt;directory&gt; 克隆到指定的目录&lt;/p&gt;
&lt;figure class=&#34;highlight plain&#34;&gt;&lt;table&gt;&lt;tr&gt;&lt;td class=&#34;gutter&#34;&gt;&lt;pre&gt;&lt;span class=&#34;line&#34;&gt;1&lt;/span&gt;&lt;br&gt;&lt;/pre&gt;&lt;/td&gt;&lt;td class=&#34;code&#34;&gt;&lt;pre&gt;&lt;span class=&#34;line&#34;&gt;示例：git clone https:&amp;#x2F;&amp;#x2F;gitee.com&amp;#x2F;medua&amp;#x2F;test.git&lt;/span&gt;&lt;br&gt;&lt;/pre&gt;&lt;/td&gt;&lt;/tr&gt;&lt;/table&gt;&lt;/figure&gt;
&lt;p&gt;6.git status 命令用于查看项目的当前状态&lt;br&gt;
 7.git diff 命令显示已写入缓存与已修改但尚未写入缓存的改动的区别&lt;br&gt;
 8.git commit 使用 git add 命令将想要快照的内容写入缓存区， 而执行 git commit 将缓存区内容添加到仓库中。&lt;br&gt;
9.git rm 从 Git 中移除某个文件&lt;/p&gt;
